import NavBar from './Navig/NavBar'
import Slider from './Slider/Slider'

const Header = ({ testDriveForm }) => {

  const handlerMdlWindow = (data) => {
    testDriveForm(data)
  }

  return (
    <>
      <NavBar mdlWindow={handlerMdlWindow} />
      <Slider />
    </>
  )
}

export default Header
